description: >-
  Alle Tanzbegeisterten treffen sich jeden Sonntag im Salón Cubano. Im Münchner
  Kulturzentrum Giesinger Bahnhof wird in der Saison von Oktober bis März zu
  lateinamerikanischen Rhythmen getanzt.


  Party: 17 – 21 Uhr. Immer wieder Sonntags.


  Zusätzlich gibt es von 16 – 17 Uhr meist auch Tanzkurse, für Anfänger und Fortgeschrittene aller Stilrichtungen.


  Hier findet Ihr die Details zu den nächsten Veranstaltungen und Tanzkursen, und natürlich eine Übersicht über alle Termine der nächsten Saison.


  Und jede Menge Spaß.
